/** @type {import('prettier').Config} */
export default {
	useTabs: true,
	singleQuote: true,
	semi: false,
	trailingComma: 'none',
	printWidth: 100,
	plugins: ['prettier-plugin-astro', 'prettier-plugin-svelte', 'prettier-plugin-tailwindcss'],
	overrides: [
		{
			files: '*.astro',
			options: {
				parser: 'astro'
			}
		},
		{
			files: '*.svelte',
			options: {
				parser: 'svelte'
			}
		}
	]
}

{
	"compilerOptions": {
		// Stricter linting during builds:
		"noUnusedLocals": true,
		"noUnusedParameters": true,
		// "exactOptionalPropertyTypes": true,
		"allowUnreachableCode": false,
		"allowUnusedLabels": false,
		"stripInternal": true,
		"noEmitOnError": true
	}
}
